description:
Results from version 4.0 of the 4km-resolution regional-scale hydrodynamic model of the Great Barrier Reef (GBR4). This model is forced with:

Surface Atmospheric Data: Bureau of Meteorology Atmospheric high-resolution Regional Reanalysis for Australia, using Data Assimilation of Quality Control observations (BARRA);
Ocean Boundaries: CSIRO Bluelink Reanalysis using Data Assimilation of Quality Control observations (BRAN2020) model results;
Tide: global TPXO tide model;
River boundaries: measured stream flow and temperature data for 64 rivers from a combination of the Bureau of Meteorology Grid 2 Grid catchment model (G2Gv3) and the QLD DES Source catchment model.

This model configuration and associated results dataset may be referred to as "GBR4_H4p0_ABARRAr2_OBRAN2020_FG2Gv3_Dhnd" according to the eReefs simulation naming protocol. 
The model ran in hindcast mode and is complete. It succeeds the GBR4_H2p0 model as the best available eReefs hydrodynamic model results for its timespan.
